wA97J Full Episodes: https:\/\/9now.app.link\/uNP4qBkmN6 | Love and other catastrophes (2020)\\n\\nTheres no better feeling than being in love. And there are few worse feelings than love gone wrong. When it happens it can be bizarre, and at times incredibly cruel. Former couple, rugby league star Josh Reynolds and Instagram lingerie model Arabella Del Busso, can certainly attest to that. As is often the way with modern romances, their attraction to each other was as instant as it was passionate. But their relationship ended as a very public police matter. Then the story got even stranger. Claims of fake pregnancies, fake cancers, fake funerals and domestic violence caused more scandalous headlines. Many people assumed Josh was just another footballer behaving badly until it emerged that Arabella was not necessarily the victim she said she was. In a special edition of 60 MINUTES, Tom Steinfort speaks to the warring parties as he explains this twisted tale of doomed romance.\\n\\nWATCH more of 60 Minutes Australia: https:\/\/www.60minutes.com.au \\nLIKE 60 Minutes Australia on Facebook: https:\/\/www.facebook.com\/60Minutes9 \\nFOLLOW 60 Minutes Australia on Twitter: https:\/\/twitter.com\/60Mins \\nFOLLOW 60 Minutes Australia on Instagram: https:\/\/www.instagram.com\/60minutes9\\n\\nFor forty years, 60 Minutes have been telling Australians the worlds greatest stories. Tales that changed history, our nation and our lives. Reporters Liz Hayes, Allison Langdon, Tara Brown, Charles Wooley, Liam Bartlett and Sarah Abo look past the headlines because there is always a bigger picture. Sundays are for 60 Minutes.\\n\\n#60MinutesAustralia\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/XNvq8pzgvVw\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLAvZQPKEdFLstJiDaE9ern-sOsRBg\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/XNvq8pzgvVw\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWv e. But their relationship ended as a very public police matter. Then the story got even stranger. Claims of fake pregnancies, fake cancers, fake funerals and domestic violence caused more scandalous headlines. Many people assumed Josh was just another footballer behaving badly until it emerged that Arabella was not necessarily the victim she said she was. In a special edition of 60 MINUTES, Tom Steinfort speaks to the warring parties as he explains this twisted tale of doomed romance.\\n\\nWATCH more of 60 Minutes Australia: https:\/\/www.60minutes.com.au \\nLIKE 60 Minutes Australia on Facebook: https:\/\/www.facebook.com\/60Minutes9 \\nFOLLOW 60 Minutes Australia on Twitter: https:\/\/twitter.com\/60Mins \\nFOLLOW 60 Minutes Australia on Instagram: https:\/\/www.instagram.com\/60minutes9\\n\\nFor forty years, 60 Minutes have been telling Australians the worlds greatest stories. Tales that changed history, our nation and our lives. Reporters Liz Hayes, Allison Langdon, Tara Brown, Charles Wooley, Liam Bartlett and Sarah Abo look past the headlines because there is always a bigger picture. Sundays are for 60 Minutes.\\n\\n#60MinutesAustralia\"},\"lengthSeconds\":\"2543\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/60Minutes9\",\"externalChannelId\":\"UC0L1suV8pVgO4pCAIBNGx5w\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"
